using namespace std;
typedef long long ll;
typedef unordered_map<int, int> ctr;

const int BUF = 1<<15;
char inbuf[BUF]; int inpos, inlen;
char next() {
    if (inpos==inlen) {
        inpos=0; inlen=(int)fread(inbuf,1,BUF,stdin);
        if (!inlen) return EOF;
    }
    return inbuf[inpos++];
}
int read() {
    char c;
    while (!isdigit(c=next())) {}
    int x=c-48;
    while (isdigit(c=next())) x = x*10+(c-48);
    return x;
}

ll pow(ll b, ll e, ll mod) {
    ll r = 1;
    while (e>0) {
        if (e%2) r = (r*b)%mod;
        b = (b*b) % mod; e >>= 1;
    }
    return r;
}

ll gcd(ll a, ll b) {
    while (b) { ll t = a; a = b; b = t%a; }
    return a;
}

ll pollard_rho_brent(ll n) {
    while (true) {
        ll y = 1+rand()%(n-1), c = 1+rand()%(n-1), m = 1+rand()%(n-1);
        ll g = 1, r = 1, q = 1, x, k, s;
        while (g == 1) {
            x = y; k = 0;
            for (int i = 0; i < r; i++) y = (y*y+c)%n;
            while (k < r && g == 1) {
                s = y;
                for (int i = 0; i < min(m, r-k); i++) { y = (y*y+c)%n; q = q*abs(x-y)%n; }
                g = gcd(q, n); k += m;
            }
            r *= 2;
        }
        if (g == n) g = 1;
        while (g == 1) { s = (s*s+c)%n; g = gcd(abs(x-s), n); }
        if (g != n) return g;
    }
}

