bool miller_rabin(ll p) {
    if (p < PC) return P[p];
    ll d = p - 1; ll s = 0;
    while (!(d%2)) { d /= 2; s++; }
    for (int i = 0; i < 3; i++) {
        ll a = 2+rand()%(p-3); ll x = pow(a, d, p);
        if (x == 1 || x == p-1) continue;
        bool ok = false;
        for (int j = 0; j < s; j++) {
            x = x*x%p;
            if (x == 1) return false;
            if (x == p-1) { ok = true; break; }
        }
        if (!ok) return false;
    }
    return true;
}

void fact(ll n, ctr& pf) {
    while (n != 1) {
        if (miller_rabin(n)) {
            if (n%4 == 1) pf[n]++;
            break;
        }
        ll d = pollard_rho_brent(n);
        fact(d, pf); n /= d;
    }
}

int main() {
    cin.tie(NULL);
    cout.tie(NULL);
    srand(time(0));
    for (int m = 2; m < LIMIT; m++)
        for (int n = 1+(m%2); m*m+n*n <= MAX && n < m; n += 2)
            if (gcd(m, n)==1) triples[(m*m+n*n)/4].pb((m*m-n*n)*MAX+2*m*n);

    ctr C;
    int na=read(), nb=read(), nc=read();
    ll v, Z=0;
    while (na--) A[read()]++;
    while (nb--) B[read()]++;
    while (nc--) C[read()]++;

    for (auto& [c, ck] : C) {
        ll cc = c, add = 0;
        vector<pair<int, ll>> st = {{0, 1}};
        while (!(cc%2)) cc /= 2;
        while (!(cc%3)) cc /= 3;
        ctr pf; fact(cc, pf);
        vector<pair<ll, ll>> pfl(pf.begin(), pf.end());
        while (!st.empty()) {
            auto [i, v] = st.back();
            st.pop_back();
            if (i == pfl.size()) {
                ll k = c/v;
                for (ll& ab : triples[v/4]) { ll a = ab/MAX, b = ab%MAX; add += A[a*k]*B[b*k]+B[a*k]*A[b*k]; }
                continue;
            }
            auto [p, e] = pfl[i];
            for (int j = 0; j <= e; j++) { st.eb(i+1, v); v *= p; }
        }
        Z += add*ck;
    }
    cout << Z;
    return 0;
}